pragma solidity >= 0.7.0 < 0.9.0;

contract LuckyWinner {
    address winner;
    uint amount;

    function pay() external payable {
        require(msg.value == 1, "You can pay only 1 Ether at a time.");
        amount += 1;
        if (amount == 3){
            winner = msg.sender;
        }
    }

    function withdraw() public {
        require(winner == msg.sender, "You are not the winner of this lucky draw.");
        (bool sent, ) = payable(winner).call{value:100}("");
        require(sent , "Payment failed");
    }
}


